package dev.web.obelab.bean;

import java.util.Date;

import org.apache.ibatis.type.Alias;
@Alias("doctor")
public class DoctorBean {
	private Integer doc_num;
	private String doc_email;
	private String doc_pw;
	private String doc_last_name;
	private String doc_first_name;
	private String doc_tel;
	private String doc_department;
	private String doc_use_status;
	private String doc_task;
	private String doc_analysis;
	private String doc_report;
	private Date doc_reg_date;
	private String doc_del_status;
	
	public DoctorBean() {
		// TODO Auto-generated constructor stub
	}
	
	public Integer getDoc_num() {
		return doc_num; 
	}

	public void setDoc_num(Integer doc_num) {
		this.doc_num = doc_num;
	}

	public String getDoc_email() {
		return doc_email;
	}

	public void setDoc_email(String doc_email) {
		this.doc_email = doc_email;
	}

	public String getDoc_pw() {
		return doc_pw;
	}

	public void setDoc_pw(String doc_pw) {
		this.doc_pw = doc_pw;
	}

	public String getDoc_last_name() {
		return doc_last_name;
	}

	public void setDoc_last_name(String doc_last_name) {
		this.doc_last_name = doc_last_name;
	}

	public String getDoc_first_name() {
		return doc_first_name;
	}

	public void setDoc_first_name(String doc_first_name) {
		this.doc_first_name = doc_first_name;
	}

	public String getDoc_tel() {
		return doc_tel;
	}

	public void setDoc_tel(String doc_tel) {
		this.doc_tel = doc_tel;
	}

	public String getDoc_department() {
		return doc_department;
	}

	public void setDoc_department(String doc_department) {
		this.doc_department = doc_department;
	}

	public String getDoc_use_status() {
		return doc_use_status;
	}

	public void setDoc_use_status(String doc_use_status) {
		this.doc_use_status = doc_use_status;
	}

	public String getDoc_task() {
		return doc_task;
	}

	public void setDoc_task(String doc_task) {
		this.doc_task = doc_task;
		
	}

	public String getDoc_analysis() {
		return doc_analysis;
	}

	public void setDoc_analysis(String doc_analysis) {
		this.doc_analysis = doc_analysis;
	}

	public String getDoc_report() {
		return doc_report;
	}

	public void setDoc_report(String doc_report) {
		this.doc_report = doc_report;
	}

	public Date getDoc_reg_date() {
		return doc_reg_date;
	}

	public void setDoc_reg_date(Date doc_reg_date) {
		this.doc_reg_date = doc_reg_date;
	}

	public String getDoc_del_status() {
		return doc_del_status;
	}

	public void setDoc_del_status(String doc_del_status) {
		this.doc_del_status = doc_del_status;
	}
	
	
	
}
